window.bookSummaryJSON = "<p>The sequel to <i>Uncommon Stock: Version 1.0</i>, the top 10 best-selling tech startup thriller. </p> <p>Mara Winkel is the CEO of Mozaik, the fastest-growing tech startup in Boulder, CO. But Mozaik doesn't just build widgets; their software uncovers financial fraud. </p> <p>When Mozaik's first major project reveals a dark secret at the heart of a large international bank, Mara and her team get sucked deeper into a conspiracy of dangerous money launderers, dysfunctional team members, and shady venture capitalists. </p> <p>Can they build a new business and survive intact? Their company and their lives are on the line. </p>"; 
